import React, { Component } from "react";
import "./laystyle.css"

class SignUp extends Component{
    render(){
        return(
        <form id="signup">
             <label> First Name </label>
          <input type="text" required />

          <label>Email Address </label>
            <input type="email"required />

            <label>Gender </label>
        
            <input class="w3-radio" type="radio" name="gender" value="male" checked></input>
            <label className="gender">Male</label>

           <input class="w3-radio" type="radio" name="gender" value="female"></input>
            <label className="gender">Female</label>
  
           <input class="w3-radio" type="radio" name="gender" value="" disabled></input>
           <label  className="gender">other</label>
        
<br></br>
            <label> Set A Password</label>
            <input type="password"required />

            <button type="submit" id="submit">submit</button>
        </form>
           
        )
    }
}
  export default SignUp;
